    true,nt"url": null,nt"notes": "This handbook provides a selection of the
    most important and frequently used atomic spectroscopic data in an easily accessible
    format. The compilation includes energy levels, ionization energies, wavelengths,
    line intensities, transition probabilities, and spectrum assignments for the neutral
    and singly-ionized atoms of all elements hydrogen through einsteinium (Z = 1-99),
    given in separate tables for each element. It includes approximately 12,000 spectral
    lines of all elements. Bibliographic references are provided for all data.",nt"license_title":
